import "./App.css";
import Signin from "./Components/Pages/Signin/Signin";
import Signup from "./Components/Pages/Signup/Signup";
import { Route, Routes } from "react-router-dom";
// import Home from "./Components/Pages/Home/Home";
// import AddProjects from "./Components/Pages/Projects/AddProjects";
// import AllProjects from "./Components/Pages/Projects/DisplayProjects/AllProjects";
import ProjectsPath from "./Components/Pages/Projects/ProjectsPath"
import Projects from "./Components/Pages/Projects/Projects";

function App() {
  return (
    <>
      {/* <AllProjects /> */}
      <Routes>
        {/* <Route path="/home" element={<Home />}></Route> */}
        <Route path="/signin" element={<Signin />}></Route>
        <Route path="/signup" element={<Signup />}></Route>
        <Route path="projects" element={<ProjectsPath />}>
        <Route  path=":type" element={<Projects />}></Route>
        </Route>
        <Route exact path="/projects/:type" element={<Projects />}></Route>

      </Routes>
    </>
  );
}

export default App;
